import React from 'react'
import TextField from '@mui/material/TextField';
import Autocomplete from '@mui/material/Autocomplete';


const top100Films = [
    {label: 'Indai' },
    {label: 'US' },
    {label: 'UK' },
    {label: 'Canada' },
    {label: 'China' },

    ];
const Input = () => {
    return (
        <div>
            <TextField id="outlined-basic" label="User's name" variant="outlined" />
            <TextField
                id="outlined-multiline-static"
                label="Address"
                multiline
                rows={4}
                defaultValue=""
            />

            <Autocomplete
                disablePortal
                id="combo-box-demo"
                options={top100Films}
                sx={{ width: 300 }}
                renderInput={(params) => <TextField {...params} label="Country" />}
            />


        </div>
    )
}

export default Input
